import React from "react";
import "./style.css";

const devData = [
  { username: "testUser1", password: "hello12345" },
  { username: "testUser2", password: "12345hello" },
];

const App = () => {
  const [user, setUser] = React.useState(devData);
  return (
    <div className="body">
      <h4>Our Developers</h4>
      <h5>Username:{user.username}</h5>
      <h5>Password: {user.password}</h5>
    </div>
  );
};

export default App;
